import * as React from "react";
import Box from "@mui/material/Box";
import Tab from "@mui/material/Tab";
import TabContext from "@mui/lab/TabContext";
import TabList from "@mui/lab/TabList";
import TabPanel from "@mui/lab/TabPanel";
import { Button, Typography } from "@mui/material";
import { Container } from "@mui/system";

export default function ProductHot() {
  const [value, setValue] = React.useState("1");

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Box
      sx={{
        width: "100%",
        typography: "body1",
        display: "flex",
        flexDirection:"column",
        justifyContent: "center",
      }}
    >
      <Button
        sx={{
          fontSize: { xs: 18, md: 20, lg: 30 },
          m: 2,
          fontFamily: "Comic Sans MS",
         
        }}
      >
       Hot Products
      </Button>
      <TabContext value={value}>
        <Box
          sx={{
            borderBottom: 1,
            borderColor: "divider",
            display: "flex",
            fontSize: { xs: 14, md: 18, lg: 20 },
            justifyContent: "center",
          }}
        >
          <TabList onChange={handleChange} aria-label="lab API tabs example">
            <Tab label="Discount" value="1" />
            <Tab label="New Product" value="2" />
          </TabList>
        </Box>
        <TabPanel value="1">Discount</TabPanel>
        <TabPanel value="2">New Products</TabPanel>
      </TabContext>
    </Box>
  );
}
